import React from 'react';

function Clicker(props)	
	{
	
	return(
		<div>
		{props.name}
		<button 
			name={props.name} 
			onClick={props.gainResource}> 
				{props.name} {props.value}
	
		</button>
		</div>


		)
}

export default Clicker;
